import { useSelector } from "react-redux";

export default function categoriaDePerritos(handlerFilterTemperaments) {
    const temperaments=useSelector(state=>state.temperaments)
  return (
    <div>
      <select
        className={Style.filter}
        onChange={(e) => handlerFilterTemperaments(e)}
      >
        {temperaments &&
          temperaments.map((e) => {
            return (
              <option key={e.id} value={e.name}>
                {e.name}
              </option>
            );
          })}
      </select>
    </div>
  );
}
